  return (
    <Container>
      <h1>Movies</h1>
      <MovieList>
        {/* {movie.map(movie=>{
          return(
            <Movie key={movie.id}>
              <a href="https://www.google.com.br/">
                <img
                  src={movie.image_url}
                  alt="up"
                />
              </a>
              <span>{movie.title}</span>
            </Movie>
          )
        })} */}
      </MovieList>
    </Container>
  );
};

export default index;
